Desc:
Jessie is on her way out of town and is seeking Susan for a ride to the airport. When Susan is nowhere to be found she find's Bruce laying around on the couch. Jessie kindly asks Bruce for a ride to the airport, but Bruce gets a little upset because he has been driving Jessie and Susan all over town all summer! Bruce asks Jessie what's in it for him if he takes her to the airport, Bruce just wants something in return!
